  \"washington-islands-national-wildlife-refuges-flattery-rocks-quillayute-needles-and-copalis\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This Comprehensive Conservation Plan (CCP)
  was written to guide management on Washington Islands NWRs (including Flattery Rocks,
  Quillayute Needles, and Copalis NWRs) for the next 15 years. This plan outlines
  the refuges' vision and purpose and describes how the refuges will contribute to
  the overall mission of the Refuge System. The plan provides an introduction to the
  refuges, an overview of the CCP process, goals and objectives, alternatives, a description
  of the affected environment, environmental consequences, and strategies for implementation.
  Key planning issues include: public awareness, tribal coordination, disturbance,
  monitoring, contaminants, and invasive species management.\",\n\t\"license_title\":
